package net.codejava.spring.model;

public class Appointment {
	private String name;
	private String emailId;
	private String phoneNo;
	private String preferredLoc;
	private String preferredDate;
	private String gender;
	private String symtoms;
	private String time;
	private String enquiryQuery;
	
	public Appointment() {
		// TODO Auto-generated constructor stub
	}
	
	public String getName() {
		return name;
	}
	public void setName(String name) {
		this.name = name;
	}
	public String getEmailId() {
		return emailId;
	}
	public void setEmailId(String emailId) {
		this.emailId = emailId;
	}
	public String getPhoneNo() {
		return phoneNo;
	}
	public void setPhoneNo(String phoneNo) {
		this.phoneNo = phoneNo;
	}
	public String getPreferredLoc() {
		return preferredLoc;
	}
	public void setPreferredLoc(String preferredLoc) {
		this.preferredLoc = preferredLoc;
	}
	public String getPreferredDate() {
		return preferredDate;
	}
	public void setPreferredDate(String preferredDate) {
		this.preferredDate = preferredDate;
	}
	public String getGender() {
		return gender;
	}
	public void setGender(String gender) {
		this.gender = gender;
	}
	public String getSymtoms() {
		return symtoms;
	}
	public void setSymtoms(String symtoms) {
		this.symtoms = symtoms;
	}
	public String getTime() {
		return time;
	}
	public void setTime(String time) {
		this.time = time;
	}

	public String getEnquiryQuery() {
		return enquiryQuery;
	}

	public void setEnquiryQuery(String enquiryQuery) {
		this.enquiryQuery = enquiryQuery;
	}
	
	
	
	
	
}
